import React from "react";
import { Link } from "react-router-dom";
// reactstrap components
import {
  Button,
  Collapse,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  UncontrolledDropdown,
  NavbarBrand,
  Navbar,
  NavItem,
  NavLink,
  Nav,
  Container,
  UncontrolledTooltip
} from "reactstrap";

const NavigationNonAuth = () => (
  <Navbar className="fixed-top" expand="lg" color="info">
    <Container>
      <div className="navbar-translate">
        <NavbarBrand
          target="_blank"
          id="navbar-brand"
        >
          <Link to={routes.LANDING}> Masters Friend </Link>
        </NavbarBrand>
      </div>
        <Nav navbar>
          <NavItem>
              <Button className="btn-round" color="info">
              <Link to={routes.HOME}>University Suggestor</Link>
              </Button>
          </NavItem>
          <NavItem>
            <Button className="btn-round" color="info">
              <Link to={routes.SIGN_IN}>Sign In</Link>
            </Button>
          </NavItem>
        </Nav>
    </Container>
  </Navbar>
);


const NavigationAuth = ({ userInfo }) => (
  <Navbar className="fixed-top" expand="lg" color="info">
    <Container>
      <div className="navbar-translate">
        <NavbarBrand
          target="_blank"
          id="navbar-brand"
        >
          <Link to={routes.LANDING}> Masters Friend </Link>
        </NavbarBrand>
      </div>
        <Nav navbar>
          <NavItem>
              <Button className="btn-round" color="info">
              <Link to={routes.HOME}>University Suggestor</Link>
              </Button>
          </NavItem>
          <NavItem>
            <Button className="btn-round" color="info">
              <Link to={routes.ACCOUNT}>Account</Link>
            </Button>
          </NavItem>
          <NavItem>
            <Button className="btn-round" color="info">
              <SignOutButton/>
            </Button>
          </NavItem>
        </Nav>
    </Container>
  </Navbar>
);

export default Navigation;
